import { NavLink } from './NavLink';

export const Navbar = () => {
    return (
        <nav className="w-full p-4 shadow bg-white">
            <div className="container mx-auto px-4 flex justify-between items-center lg:flex lg:justify-between lg:items-center">
                <ul className="flex flex-col lg:flex-row justify-center lg:flex-no-wrap">
                    <NavLink title="Mans ceļš uz Latvijas Universitāti" href="/" className="whitespace-nowrap" />
                    <NavLink title="Ceļš līdz izvēlei" href="/wishlists" className="whitespace-nowrap" />
                    <NavLink title="Ceļš uz LU DF" href="/wishlist/create" className="whitespace-nowrap" />
                    <NavLink title="Mācību pieredze" href="/about" className="whitespace-nowrap" />
                    <NavLink title="Lietotie resursi" href="/about" className="whitespace-nowrap" />
                </ul>
            </div>
        </nav>
    );
};
